import React from 'react'
import HorizontalScroll from 'react-scroll-horizontal'

export default function Project() {

    const child = { width: `300em`, height: `100%`}

    return (
        <body>
        <HorizontalScroll>
            <div style={child} />
        </HorizontalScroll>
        </body>

    )
}
